import React from 'react';

function MenuBar() {
  // Función para manejar la selección de la opción del menú
  const handleMenuClick = (option) => {
    // Aquí puedes agregar lógica para manejar la selección de la opción del menú
    console.log(`Opción seleccionada: ${option}`);
  };

  return (
    <div style={{ backgroundColor: '#333', color: '#fff', padding: '10px 0' }}>
      <ul style={{ listStyle: 'none', margin: 0, padding: 0, display: 'flex' }}>
        <li style={{ marginRight: '20px', cursor: 'pointer' }} onClick={() => handleMenuClick('Inicio')}>Inicio</li>
        <li style={{ marginRight: '20px', cursor: 'pointer' }} onClick={() => handleMenuClick('Productos')}>Productos</li>
        <li style={{ marginRight: '20px', cursor: 'pointer' }} onClick={() => handleMenuClick('Servicios')}>Servicios</li>
        <li style={{ cursor: 'pointer' }} onClick={() => handleMenuClick('Contacto')}>Contacto</li>
      </ul>
    </div>
  );
}

export default MenuBar;
